(ns advent-2018.day-5
  (:require [criterium.core :as criterium]))

(def test-data "dabAcCaCBAcCcaDA")

(def data "")

(defn reacts? [l r]
  (= 32 (Math/abs (- (int l)
                     (int r)))))

(comment
  ;; not so good (80 ms)
  (criterium/quick-bench
    (let [sb (StringBuilder. ^String data)]
      (loop [i 0]
        (let [j (inc i)]
          (if (< j (.length sb))
            (let [l (.codePointAt sb i)
                  r (.codePointAt sb j)]
              (if (reacts? l r)
                (do (.deleteCharAt sb i)
                    (.deleteCharAt sb i)
                    (recur (max 0 (dec i))))
                (recur (inc i))))
            (count (.toString sb)))))))

  ;; much much better (3 ms)
  (criterium/quick-bench
    (loop [data (seq data)
           res '()]
      (if (seq data)
        (let [f (first data)]
          (recur (rest data)
                 (if (and (seq res)
                          (reacts? f (peek res)))
                   (pop res)
                   (conj res f))))
        (count res)))))

;; recursion < reduction < sequence ops
(defn react [in]
  (reduce (fn [res c]
            (if (and (seq res)
                     (reacts? c (peek res)))
              (pop res)
              (conj res c)))
          '()
          in))

(defn part-1 [in]
  (count (react in)))

(defn part-2 []
  (criterium/quick-bench
    (let [react-once (react data)]
      (apply min (pmap part-1
                       (map (fn [upper lower]
                              (remove #{(char upper)
                                        (char lower)}
                                      react-once))
                            (range 65 91)
                            (range 97 123)))))))
